import React from "react";

function Header() {
  return (
    <>
    <h1>Введение test</h1>
    <div className="image_site">
        <Image src="https://static.promopult.ru/uploads/library/img/home-page_img_2.png"></Image>
    </div>
    <h1>Введение test</h1>
    </>
  );
}
// Add CSS styles for the header


export default Header;
